//FUNCTIONS ======================================================================================


function StartGame() {
    ResetParameters();
    PickWord();
    ConstructBoard();
    ChangeSettingsModal("hide");
    console.log(magicWord);
}

//reset parameters on page
function ResetParameters(){
    let board = document.querySelector(".board");
    board.textContent = "";
    rowIndex = 0;
    let charKeys = document.querySelectorAll(".char-key");
    for (let i=0; i<charKeys.length; i++){
        charKeys[i].classList.remove("key-green");
        charKeys[i].classList.remove("key-yellow");
        charKeys[i].classList.remove("key-gray");
    }
}

//set the magic word
function PickWord() {
    let temp_words = new Array;
    for (let i = 0; i < words.length; i++) {
        if (words[i].length == optionsLetterNumber) temp_words.push(words[i]);
    }
    let random = Math.floor(Math.random() * temp_words.length)
    magicWord = temp_words[random];
}

//create the word table
function ConstructBoard() {
    let board = document.querySelector(".board");
    for (let i = 0; i < optionsChanceNumber; i++) {
        let newWord = document.createElement("div");
        newWord.classList.add("word");
        for (let j = 0; j < optionsLetterNumber; j++) {
            let newLetter = document.createElement("div");
            newLetter.classList.add("letter");
            newLetter.classList.add("r" + i);
            let newLetterValue = document.createElement("p");
            newLetterValue.classList.add("letter-value");
            newLetterValue.classList.add("rv" + i);
            newLetter.appendChild(newLetterValue);
            newWord.appendChild(newLetter);
        }
        board.appendChild(newWord);
    }
}

//show-hide settings modal
function ChangeSettingsModal(value) {
    let temp_modal = document.querySelector(".settings-modal");
    if (value == "hide") {
        temp_modal.classList.remove("modal-show");
        temp_modal.classList.add("modal-hide");
    } else {
        temp_modal.classList.remove("modal-hide");
        temp_modal.classList.add("modal-show");
    }
}

//type in current row
function TypeWord(key) {
    let currentLetterValues = document.querySelectorAll(".rv" + rowIndex);
    for (let i = 0; i < currentLetterValues.length; i++) {
        if (currentLetterValues[i].textContent == "") {
            currentLetterValues[i].textContent = key;
            break;
        }
    }
}

//delete from current row
function Backspace() {
    let currentLetters = document.querySelectorAll(".r" + rowIndex);
    let currentLetterValues = document.querySelectorAll(".rv" + rowIndex);
    for (let i = currentLetterValues.length - 1; i >= 0; i--) {
        if (currentLetterValues[i].textContent != "") {
            for (let j = 0; j < currentLetters.length; j++) {
                currentLetters[j].classList.remove("letter-nonexistent");
            }
            currentLetterValues[i].textContent = "";
            break;
        }
    }
}

//ENTER to guess word
function GuessWord() {
    let currentLetters = document.querySelectorAll(".r" + rowIndex);
    let currentLetterValues = document.querySelectorAll(".rv" + rowIndex);
    if (currentLetterValues[currentLetterValues.length - 1].textContent == "") {
        return;
    }

    let guessedWord = "";
    let tempMagicWord = magicWord;
    let tempGuessedWord;
    for (let i = 0; i < currentLetterValues.length; i++) {
        guessedWord += currentLetterValues[i].textContent;
    }
    guessedWord = guessedWord.toLowerCase();
    let wordExists = false;
    for (let i = 0; i < dictionary.length; i++) {
        if (dictionary[i] == guessedWord) {
            wordExists = true;
        }
    }
    if (!wordExists) {
        for (let i = 0; i < currentLetters.length; i++) {
            currentLetters[i].classList.add("letter-nonexistent");
        }
        return;
    } else {
        tempGuessedWord = guessedWord;
        for (let i = 0; i < magicWord.length; i++) {
            if (magicWord[i] == guessedWord[i]) {
                let tempKey = document.querySelector("#key-"+magicWord[i]);
                tempKey.classList.remove("key-yellow");
                tempKey.classList.add("key-green");
                currentLetters[i].classList.add("letter-correct");
                tempMagicWord = tempMagicWord.replace(tempMagicWord[i].toString(), "*");
                tempGuessedWord = tempGuessedWord.replace(tempGuessedWord[i].toString(), "&");
                correctLetters++;
            }
        }
        for (let i = 0; i < tempMagicWord.length; i++) {
            if (tempMagicWord.includes(tempGuessedWord[i])) {
                if (tempGuessedWord[i] != '&') {
                    let tempKey = document.querySelector("#key-"+tempGuessedWord[i]);
                    if (!tempKey.classList.contains("key-green")){
                        tempKey.classList.add("key-yellow");
                    }
                    currentLetters[i].classList.add("letter-half-correct");
                }
            }
            else {
                if (tempMagicWord[i] != '*') {
                    let tempKey = document.querySelector("#key-"+tempGuessedWord[i]);
                    tempKey.classList.add("key-gray");
                    currentLetters[i].classList.add("letter-incorrect");
                }
            }
        }
        rowIndex++;
        if (correctLetters == magicWord.length) {
            setTimeout(() => {ShowEndgameModal("win")}, 500);
            return;
        }
        if (rowIndex == optionsChanceNumber) {
            setTimeout(() => {ShowEndgameModal("lose")}, 500);
            return;
        }
        correctLetters = 0;
    }
}

//endgame screen
function ShowEndgameModal(result) {
    let endgameModal = document.querySelector(".endgame-modal");
    endgameModal.classList.remove("modal-hide");
    endgameModal.classList.add("modal-show");
    let gameResult = document.querySelector("#game-result");
    let iconWin = document.querySelector(".icon-win");
    let iconLose = document.querySelector(".icon-lose");

    if (result == "win") {
        gameResult.textContent = "You son of a bitch, you did it!";
        iconLose.classList.add("icon-hide");
        iconLose.classList.remove("icon-show");
        iconWin.classList.add("icon-show");
        iconWin.classList.remove("icon-hide");
    } else {
        gameResult.textContent = "You fucking disgrace.";
        iconWin.classList.add("icon-hide");
        iconWin.classList.remove("icon-show");
        iconLose.classList.add("icon-show");
        iconLose.classList.remove("icon-hide");
    }
}
